import React, { useState } from 'react';
import { GoogleLogin } from '@react-oauth/google';
import '../styles/Login.css';

const Login = () => {
  const [loginData, setLoginData] = useState({ email: '' });

  const handleChange = (e) => {
    setLoginData({ ...loginData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Account created for:', loginData);
  };

  return (
    <div className="login-page">
      <div className="login-container">
        {/* Left Logo or Graphic */}
        <div className="login-left">
          <h1 className="login-logo">X</h1>
        </div>

        {/* Right Content */}
        <div className="login-right">
          <h1>Happening now</h1>
          <h2>Join today.</h2>
          <div className="google-login">
            <GoogleLogin
              onSuccess={() => console.log('Google Login Success')}
              onError={() => console.log('Login Failed')}
            />
          </div>
          <button className="apple-login">Sign up with Apple</button>
          <div className="divider">or</div>
          <form onSubmit={handleSubmit}>
            <input
              type="email"
              name="email"
              placeholder="Email"
              value={loginData.email}
              onChange={handleChange}
              required
            />
            <button type="submit" className="create-account">Create account</button>
          </form>
          <p className="terms">
            By signing up, you agree to the <a href="#">Terms of Service</a> and <a href="#">Privacy Policy</a>.
          </p>
          <p className="already">
            Already have an account? <a href="#" className="signin">Sign in</a>
          </p>
        </div>
      </div>
    </div>
  );
};

export default Login;
